import * as mjs from 'makerjs';

let models = {
  outline: new mjs.models.Rectangle(50, 100),
  lip: new mjs.models.Rectangle(50, 20)
}

let model = {models}

console.log(model)

let kk = mjs.exporter.toSVG(model);

export {kk};
